import datetime


class Solution(object):
    def validPalindrome(self, s: str) -> bool:

        if len(s) > 50000:
            return False
        elif s[::-1] == s:
            return True
        else:
            i = 0
            j = len(s)
            while i <= j:
                istr = s[0:i]+s[i+1:len(s)]
                jstr = s[0:j] + s[j+1:len(s)]
                # if self.checkpalindrome(istr) or self.checkpalindrome(jstr):
                if istr[::-1] == istr or jstr[::-1] == jstr:
                    return True
                else:
                    i += 1
                    j -= 1
        return False


print(datetime.datetime.now())
print(Solution().validPalindrome("abc"))
